One of the hallmarks of the Arrow format is that its in-memory representation has a specification, which allows languages to share data structures via foreign interfaces at zero cost (i.e. via pointers). This is known as the C Data interface . This crate supports importing from and exporting to all its physical types. The example below demonstrates how to use the API: use arrow2::array::{Array, PrimitiveArray};
use arrow2::datatypes::Field;
use arrow2::error::Result;
use arrow2::ffi;
use std::sync::Arc; unsafe fn export( array: Arc<dyn Array>, array_ptr: *mut ffi::ArrowArray, schema_ptr: *mut ffi::ArrowSchema,
) { // exporting an array requires an associated field so that the consumer knows its datatype let field = Field::new("a", array.data_type().clone(), true); ffi::export_array_to_c(array, array_ptr); ffi::export_field_to_c(&field, schema_ptr);
} unsafe fn import(array: Box<ffi::ArrowArray>, schema: &ffi::ArrowSchema) -> Result<Box<dyn Array>> { let field = ffi::import_field_from_c(schema)?; ffi::import_array_from_c(array, field.data_type)
} fn main() -> Result<()> { // let's assume that we have an array: let array = PrimitiveArray::<i32>::from([Some(1), None, Some(123)]).arced(); // the goal is to export this array and import it back via FFI. // to import, we initialize the structs that will receive the data let mut array_ptr = Box::new(ffi::ArrowArray::empty()); let mut schema_ptr = Box::new(ffi::ArrowSchema::empty()); // this is where a producer (in this case also us ^_^) writes to the pointers' location. // `array` here could be anything or not even be available, if this was e.g. from Python. // Safety: we just allocated the pointers unsafe { export(array.clone(), &mut *array_ptr, &mut *schema_ptr) }; // and finally interpret the written memory into a new array. // Safety: we used `export`, which is a valid exporter to the C data interface let new_array = unsafe { import(array_ptr, schema_ptr.as_ref())? }; // which is equal to the exported array assert_eq!(array.as_ref(), new_array.as_ref()); Ok(())
}

