There are two CPU-intensive tasks in reading a CSV file: split the CSV file into rows, which includes parsing quotes and delimiters, and is necessary to seek to a given row. parse a set of CSV rows (bytes) into a Arrays. Parsing bytes into values is more expensive than interpreting lines. As such, it is generally advantageous to have multiple readers of a single file that scan different parts of the file (within IO constraints). This crate relies on the crate csv to scan and seek CSV files, and your code also needs such a dependency. With that said, arrow2 makes no assumptions as to how to efficiently read the CSV: as a single reader per file or multiple readers. As an example, the following infers the schema and reads a CSV by re-using the same reader: use std::sync::Arc; use arrow2::array::Array;
