Arrow core trait the Array, which you can think of as representing Arc<Vec<Option<T>> with associated metadata (see metadata )). Contrarily to Arc<Vec<Option<T>>, arrays in this crate are represented in such a way that they can be zero-copied to any other Arrow implementation via foreign interfaces (FFI). Probably the simplest Array in this crate is the PrimitiveArray<T>. It can be constructed from a slice of option values, # use arrow2::array::{Array, PrimitiveArray};
# fn main() {
let array = PrimitiveArray::<i32>::from([Some(1), None, Some(123)]);
assert_eq!(array.len(), 3)
# } from a slice of values, # use arrow2::array::{Array, PrimitiveArray};
# fn main() {
let array = PrimitiveArray::<f32>::from_slice([1.0, 0.0, 123.0]);
assert_eq!(array.len(), 3)
# } or from an iterator # use arrow2::array::{Array, PrimitiveArray};
# fn main() {
let array: PrimitiveArray<u64> = [Some(1), None, Some(123)].iter().collect();
assert_eq!(array.len(), 3)
# } A PrimitiveArray (and every Array implemented in this crate) has 3 components: A physical type (e.g. i32) A logical type (e.g. DataType::Int32) Data The main differences from a Arc<Vec<Option<T>>> are: Its data is laid out in memory as a Buffer<T> and an Option<Bitmap> (see [../low_level.md]) It has an associated logical type (DataType). The first allows interoperability with Arrow's ecosystem and efficient SIMD operations (we will re-visit this below); the second is that it gives semantic meaning to the array. In the example # use arrow2::array::PrimitiveArray;
# use arrow2::datatypes::DataType;
# fn main() {
let ints = PrimitiveArray::<i32>::from([Some(1), None]);
let dates = PrimitiveArray::<i32>::from([Some(1), None]).to(DataType::Date32);
# } ints and dates have the same in-memory representation but different logic representations (e.g. dates are usually printed to users as "yyyy-mm-dd"). All physical types (e.g. i32) have a "natural" logical DataType (e.g. DataType::Int32) which is assigned when allocating arrays from iterators, slices, etc. # use arrow2::array::{Array, Int32Array, PrimitiveArray};
# use arrow2::datatypes::DataType;
# fn main() {
let array = PrimitiveArray::<i32>::from_slice([1, 0, 123]);
assert_eq!(array.data_type(), &DataType::Int32);
# } they can be cheaply (O(1)) converted to via .to(DataType). The following arrays are supported: NullArray (just holds nulls) BooleanArray (booleans) PrimitiveArray<T> (for ints, floats) Utf8Array<i32> and Utf8Array<i64> (for strings) BinaryArray<i32> and BinaryArray<i64> (for opaque binaries) FixedSizeBinaryArray (like BinaryArray, but fixed size) ListArray<i32> and ListArray<i64> (array of arrays) FixedSizeListArray (array of arrays of a fixed size) StructArray (multiple named arrays where each row has one element from each array) UnionArray (every row has a different logical type) DictionaryArray<K> (nested array with encoded values)
